# Feedback loop

Artificial example that shows hybrid type inference can benefit from a feedback loop.

**E3**
```
class C {} class D {}

void main(List<String> args) {
  var c = parse("C");
  var v;
  if (args.isEmpty && c is D) {
    v = "C";
  } else {
    v = "D";
  }
  var d = parse(v);
}

parse(String s) => s == "C" ? new C() : new D();
```

In the first soundness analysis, the type of ```d``` depends on the value of ```v```, and the value of ```v``` (spuriously) depends on the value of ```l.isEmpty``` and the type of ```o```. Since all values of ```l.isEmpty``` has not been observed, the type of ```parse(v)``` is not trusted.

By rerunning the static analysis, with the knowledge that ```c``` has type ```C```, the then-branch is pruned, and ```v``` no longer depends on anything (it is the constant string ```"D"```).

Thus, by rerunning the soundness analysis, the type of ```parse(v)``` can be trusted.

